import { Container, Row, Col, Card } from 'react-bootstrap';
import './Rolled.css'

getInitialState = () => {
  return ({ hidden: 'hidden' });
}
  componentWillMount = () => {

  }


const Rolled = ({num, text}) => {
  return (
    <Container>
      <Row className="justify-content-center">
        <Col xs={9} lg={6}>
          <Card className="mt-4 pt-2 pb-1 rollCard">
            <h5>{num + ' - ' + text}</h5>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default Rolled;
